    @test_int [(a + b*x^2)*(c + d*x^2)*(e + f*x^2)^4, x, 2, a*c*e^4*x + (1/3)*e^3*(b*c*e + a*d*e + 4*a*c*f)*x^3 + (1/5)*e^2*(2*a*f*(2*d*e + 3*c*f) + b*e*(d*e + 4*c*f))*x^5 + (2/7)*e*f*(a*f*(3*d*e + 2*c*f) + b*e*(2*d*e + 3*c*f))*x^7 + (1/9)*f^2*(a*f*(4*d*e + c*f) + 2*b*e*(3*d*e + 2*c*f))*x^9 + (1/11)*f^3*(4*b*d*e + b*c*f + a*d*f)*x^11 + (1/13)*b*d*f^4*x^13]
