    @test_int [(a + b*x^2)*(c + d*x^2)*(e + f*x^2)^2, x, 2, a*c*e^2*x + (1/3)*e*(b*c*e + a*d*e + 2*a*c*f)*x^3 + (1/5)*(a*f*(2*d*e + c*f) + b*e*(d*e + 2*c*f))*x^5 + (1/7)*f*(2*b*d*e + b*c*f + a*d*f)*x^7 + (1/9)*b*d*f^2*x^9]
    @test_int [(a + b*x^2)*(c + d*x^2)*(e + f*x^2)^1, x, 2, a*c*e*x + (1/3)*(b*c*e + a*d*e + a*c*f)*x^3 + (1/5)*(b*d*e + b*c*f + a*d*f)*x^5 + (1/7)*b*d*f*x^7]
    @test_int [(a + b*x^2)*(c + d*x^2)/(e + f*x^2)^1, x, 3, -(((3*b*d*e - 3*b*c*f - 2*a*d*f)*x)/(3*f^2)) + (d*x*(a + b*x^2))/(3*f) + ((b*e - a*f)*(d*e - c*f)*atan((sqrt(f)*x)/sqrt(e)))/(sqrt(e)*f^(5/2))]
