    @test_int [(a + b*x^2)*(c + d*x^2)/(e + f*x^2)^3, x, 3, -(((d*e - c*f)*x*(a + b*x^2))/(4*e*f*(e + f*x^2)^2)) - ((b*e*(3*d*e + c*f) - a*f*(d*e + 3*c*f))*x)/(8*e^2*f^2*(e + f*x^2)) + ((b*e*(3*d*e + c*f) + a*f*(d*e + 3*c*f))*atan((sqrt(f)*x)/sqrt(e)))/(8*e^(5/2)*f^(5/2))]
    @test_int [(a + b*x^2)*(c + d*x^2)/(e + f*x^2)^4, x, 4, -(((d*e - c*f)*x*(a + b*x^2))/(6*e*f*(e + f*x^2)^3)) - ((3*b*e*(d*e + c*f) - a*f*(d*e + 5*c*f))*x)/(24*e^2*f^2*(e + f*x^2)^2) + ((b*e*(d*e + c*f) + a*f*(d*e + 5*c*f))*x)/(16*e^3*f^2*(e + f*x^2)) + ((b*e*(d*e + c*f) + a*f*(d*e + 5*c*f))*atan((sqrt(f)*x)/sqrt(e)))/(16*e^(7/2)*f^(5/2))]


    @test_int [(a + b*x^2)*(c + d*x^2)^2*(e + f*x^2)^3, x, 2, a*c^2*e^3*x + (1/3)*c*e^2*(b*c*e + 2*a*d*e + 3*a*c*f)*x^3 + (1/5)*e*(b*c*e*(2*d*e + 3*c*f) + a*(d^2*e^2 + 6*c*d*e*f + 3*c^2*f^2))*x^5 + (1/7)*(a*f*(3*d^2*e^2 + 6*c*d*e*f + c^2*f^2) + b*e*(d^2*e^2 + 6*c*d*e*f + 3*c^2*f^2))*x^7 + (1/9)*f*(a*d*f*(3*d*e + 2*c*f) + b*(3*d^2*e^2 + 6*c*d*e*f + c^2*f^2))*x^9 + (1/11)*d*f^2*(3*b*d*e + 2*b*c*f + a*d*f)*x^11 + (1/13)*b*d^2*f^3*x^13]
    @test_int [(a + b*x^2)*(c + d*x^2)^2*(e + f*x^2)^2, x, 2, a*c^2*e^2*x + (1/3)*c*e*(b*c*e + 2*a*(d*e + c*f))*x^3 + (1/5)*(2*b*c*e*(d*e + c*f) + a*(d^2*e^2 + 4*c*d*e*f + c^2*f^2))*x^5 + (1/7)*(2*a*d*f*(d*e + c*f) + b*(d^2*e^2 + 4*c*d*e*f + c^2*f^2))*x^7 + (1/9)*d*f*(a*d*f + 2*b*(d*e + c*f))*x^9 + (1/11)*b*d^2*f^2*x^11]
    @test_int [(a + b*x^2)*(c + d*x^2)^2*(e + f*x^2)^1, x, 2, a*c^2*e*x + (1/3)*c*(b*c*e + 2*a*d*e + a*c*f)*x^3 + (1/5)*(b*c*(2*d*e + c*f) + a*d*(d*e + 2*c*f))*x^5 + (1/7)*d*(b*d*e + 2*b*c*f + a*d*f)*x^7 + (1/9)*b*d^2*f*x^9]
    @test_int [(a + b*x^2)*(c + d*x^2)^2/(e + f*x^2)^1, x, 4, -(((5*a*d*f*(3*d*e - 5*c*f) - b*(15*d^2*e^2 - 25*c*d*e*f + 8*c^2*f^2))*x)/(15*f^3)) - ((5*b*d*e - 4*b*c*f - 5*a*d*f)*x*(c + d*x^2))/(15*f^2) + (b*x*(c + d*x^2)^2)/(5*f) - ((b*e - a*f)*(d*e - c*f)^2*atan((sqrt(f)*x)/sqrt(e)))/(sqrt(e)*f^(7/2))]
    @test_int [(a + b*x^2)*(c + d*x^2)^2/(e + f*x^2)^2, x, 4, -((d*(b*e*(15*d*e - 13*c*f) - 3*a*f*(3*d*e - c*f))*x)/(6*e*f^3)) + (d*(5*b*e - 3*a*f)*x*(c + d*x^2))/(6*e*f^2) - ((b*e - a*f)*x*(c + d*x^2)^2)/(2*e*f*(e + f*x^2)) + ((d*e - c*f)*(b*e*(5*d*e - c*f) - a*f*(3*d*e + c*f))*atan((sqrt(f)*x)/sqrt(e)))/(2*e^(3/2)*f^(7/2))]
    @test_int [(a + b*x^2)*(c + d*x^2)^2/(e + f*x^2)^3, x, 4, (d*(b*e*(15*d*e - c*f) - 3*a*f*(d*e + c*f))*x)/(8*e^2*f^3) - ((b*e - a*f)*x*(c + d*x^2)^2)/(4*e*f*(e + f*x^2)^2) - ((b*e*(5*d*e - c*f) - a*f*(d*e + 3*c*f))*x*(c + d*x^2))/(8*e^2*f^2*(e + f*x^2)) - ((b*e*(15*d^2*e^2 - 6*c*d*e*f - c^2*f^2) - a*f*(3*d^2*e^2 + 2*c*d*e*f + 3*c^2*f^2))*atan((sqrt(f)*x)/sqrt(e)))/(8*e^(5/2)*f^(7/2))]
    @test_int [(a + b*x^2)*(c + d*x^2)^2/(e + f*x^2)^4, x, 4, -(((b*e - a*f)*x*(c + d*x^2)^2)/(6*e*f*(e + f*x^2)^3)) - ((d*e*(5*b*e + a*f) - c*f*(b*e + 5*a*f))*x*(c + d*x^2))/(24*e^2*f^2*(e + f*x^2)^2) - ((a*f*(3*d^2*e^2 + 4*c*d*e*f - 15*c^2*f^2) + b*e*(15*d^2*e^2 - 4*c*d*e*f - 3*c^2*f^2))*x)/(48*e^3*f^3*(e + f*x^2)) + ((b*e*(5*d^2*e^2 + 2*c*d*e*f + c^2*f^2) + a*f*(d^2*e^2 + 2*c*d*e*f + 5*c^2*f^2))*atan((sqrt(f)*x)/sqrt(e)))/(16*e^(7/2)*f^(7/2))]


    @test_int [(a + b*x^2)*(c + d*x^2)^3*(e + f*x^2)^3, x, 2, a*c^3*e^3*x + (1/3)*c^2*e^2*(b*c*e + 3*a*(d*e + c*f))*x^3 + (3/5)*c*e*(b*c*e*(d*e + c*f) + a*(d^2*e^2 + 3*c*d*e*f + c^2*f^2))*x^5 + (1/7)*(3*b*c*e*(d^2*e^2 + 3*c*d*e*f + c^2*f^2) + a*(d^3*e^3 + 9*c*d^2*e^2*f + 9*c^2*d*e*f^2 + c^3*f^3))*x^7 + (1/9)*(3*a*d*f*(d^2*e^2 + 3*c*d*e*f + c^2*f^2) + b*(d^3*e^3 + 9*c*d^2*e^2*f + 9*c^2*d*e*f^2 + c^3*f^3))*x^9 + (3/11)*d*f*(a*d*f*(d*e + c*f) + b*(d^2*e^2 + 3*c*d*e*f + c^2*f^2))*x^11 + (1/13)*d^2*f^2*(a*d*f + 3*b*(d*e + c*f))*x^13 + (1/15)*b*d^3*f^3*x^15]
    @test_int [(a + b*x^2)*(c + d*x^2)^3*(e + f*x^2)^2, x, 2, a*c^3*e^2*x + (1/3)*c^2*e*(b*c*e + 3*a*d*e + 2*a*c*f)*x^3 + (1/5)*c*(b*c*e*(3*d*e + 2*c*f) + a*(3*d^2*e^2 + 6*c*d*e*f + c^2*f^2))*x^5 + (1/7)*(b*c*(3*d^2*e^2 + 6*c*d*e*f + c^2*f^2) + a*d*(d^2*e^2 + 6*c*d*e*f + 3*c^2*f^2))*x^7 + (1/9)*d*(a*d*f*(2*d*e + 3*c*f) + b*(d^2*e^2 + 6*c*d*e*f + 3*c^2*f^2))*x^9 + (1/11)*d^2*f*(2*b*d*e + 3*b*c*f + a*d*f)*x^11 + (1/13)*b*d^3*f^2*x^13]
    @test_int [(a + b*x^2)*(c + d*x^2)^3*(e + f*x^2)^1, x, 2, a*c^3*e*x + (1/3)*c^2*(b*c*e + 3*a*d*e + a*c*f)*x^3 + (1/5)*c*(3*a*d*(d*e + c*f) + b*c*(3*d*e + c*f))*x^5 + (1/7)*d*(3*b*c*(d*e + c*f) + a*d*(d*e + 3*c*f))*x^7 + (1/9)*d^2*(b*d*e + 3*b*c*f + a*d*f)*x^9 + (1/11)*b*d^3*f*x^11]
    @test_int [(a + b*x^2)*(c + d*x^2)^3/(e + f*x^2)^1, x, 5, ((7*a*d*f*(15*d^2*e^2 - 40*c*d*e*f + 33*c^2*f^2) - b*(105*d^3*e^3 - 280*c*d^2*e^2*f + 231*c^2*d*e*f^2 - 48*c^3*f^3))*x)/(105*f^4) - ((7*a*d*f*(5*d*e - 9*c*f) - b*(35*d^2*e^2 - 63*c*d*e*f + 24*c^2*f^2))*x*(c + d*x^2))/(105*f^3) - ((7*b*d*e - 6*b*c*f - 7*a*d*f)*x*(c + d*x^2)^2)/(35*f^2) + (b*x*(c + d*x^2)^3)/(7*f) + ((b*e - a*f)*(d*e - c*f)^3*atan((sqrt(f)*x)/sqrt(e)))/(sqrt(e)*f^(9/2))]
    @test_int [(a + b*x^2)*(c + d*x^2)^3/(e + f*x^2)^2, x, 5, -((d*(5*a*f*(15*d^2*e^2 - 22*c*d*e*f + 3*c^2*f^2) - b*e*(105*d^2*e^2 - 190*c*d*e*f + 81*c^2*f^2))*x)/(30*e*f^4)) - (d*(b*e*(35*d*e - 33*c*f) - 5*a*f*(5*d*e - 3*c*f))*x*(c + d*x^2))/(30*e*f^3) + (d*(7*b*e - 5*a*f)*x*(c + d*x^2)^2)/(10*e*f^2) - ((b*e - a*f)*x*(c + d*x^2)^3)/(2*e*f*(e + f*x^2)) - ((d*e - c*f)^2*(b*e*(7*d*e - c*f) - a*f*(5*d*e + c*f))*atan((sqrt(f)*x)/sqrt(e)))/(2*e^(3/2)*f^(9/2))]
    @test_int [(a + b*x^2)*(c + d*x^2)^3/(e + f*x^2)^3, x, 5, (d*(3*a*f*(15*d^2*e^2 - 4*c*d*e*f - 3*c^2*f^2) - b*e*(105*d^2*e^2 - 100*c*d*e*f + 3*c^2*f^2))*x)/(24*e^2*f^4) + (d*(b*e*(35*d*e - 3*c*f) - 3*a*f*(5*d*e + 3*c*f))*x*(c + d*x^2))/(24*e^2*f^3) - ((b*e - a*f)*x*(c + d*x^2)^3)/(4*e*f*(e + f*x^2)^2) - ((b*e*(7*d*e - c*f) - 3*a*f*(d*e + c*f))*x*(c + d*x^2)^2)/(8*e^2*f^2*(e + f*x^2)) + ((d*e - c*f)*(b*e*(35*d^2*e^2 - 10*c*d*e*f - c^2*f^2) - 3*a*f*(5*d^2*e^2 + 2*c*d*e*f + c^2*f^2))*atan((sqrt(f)*x)/sqrt(e)))/(8*e^(5/2)*f^(9/2))]
    @test_int [(a + b*x^2)*(c + d*x^2)^3/(e + f*x^2)^4, x, 5, (d*(b*e*(105*d^2*e^2 - 10*c*d*e*f - 3*c^2*f^2) - a*f*(15*d^2*e^2 + 14*c*d*e*f + 15*c^2*f^2))*x)/(48*e^3*f^4) - ((b*e - a*f)*x*(c + d*x^2)^3)/(6*e*f*(e + f*x^2)^3) - ((b*e*(7*d*e - c*f) - a*f*(d*e + 5*c*f))*x*(c + d*x^2)^2)/(24*e^2*f^2*(e + f*x^2)^2) - ((b*e*(35*d^2*e^2 - 8*c*d*e*f - 3*c^2*f^2) - a*f*(5*d^2*e^2 + 4*c*d*e*f + 15*c^2*f^2))*x*(c + d*x^2))/(48*e^3*f^3*(e + f*x^2)) - ((b*e*(35*d^3*e^3 - 15*c*d^2*e^2*f - 3*c^2*d*e*f^2 - c^3*f^3) - a*f*(5*d^3*e^3 + 3*c*d^2*e^2*f + 3*c^2*d*e*f^2 + 5*c^3*f^3))*atan((sqrt(f)*x)/sqrt(e)))/(16*e^(7/2)*f^(9/2))]


    #= ::Subsubsection:: =#
    #=q<0=#


    #= ::Subsection::Closed:: =#
