    @test_int [(a + b*x^2)*(e + f*x^2)^(1/2)*(c + d*x^2)^(3/2), x, 7, -(((7*a*d*f*(2*d^2*e^2 - 7*c*d*e*f - 3*c^2*f^2) - b*(8*d^3*e^3 - 19*c*d^2*e^2*f + 9*c^2*d*e*f^2 - 6*c^3*f^3))*x*sqrt(c + d*x^2))/(105*d^2*f^2*sqrt(e + f*x^2))) + ((7*a*d*f*(d*e + 3*c*f) - b*(4*d^2*e^2 - 6*c*d*e*f + 6*c^2*f^2))*x*sqrt(c + d*x^2)*sqrt(e + f*x^2))/(105*d*f^2) + ((b*d*e - 2*b*c*f + 7*a*d*f)*x*(c + d*x^2)^(3/2)*sqrt(e + f*x^2))/(35*d*f) + (b*x*(c + d*x^2)^(5/2)*sqrt(e + f*x^2))/(7*d) + (sqrt(e)*(7*a*d*f*(2*d^2*e^2 - 7*c*d*e*f - 3*c^2*f^2) - b*(8*d^3*e^3 - 19*c*d^2*e^2*f + 9*c^2*d*e*f^2 - 6*c^3*f^3))*sqrt(c + d*x^2)*Elliptic.E(atan((sqrt(f)*x)/sqrt(e)), 1 - (d*e)/(c*f)))/(105*d^2*f^(5/2)*sqrt((e*(c + d*x^2))/(c*(e + f*x^2)))*sqrt(e + f*x^2)) - (e^(3/2)*(7*a*d*f*(d*e - 9*c*f) - b*(4*d^2*e^2 - 9*c*d*e*f - 3*c^2*f^2))*sqrt(c + d*x^2)*Elliptic.F(atan((sqrt(f)*x)/sqrt(e)), 1 - (d*e)/(c*f)))/(105*d*f^(5/2)*sqrt((e*(c + d*x^2))/(c*(e + f*x^2)))*sqrt(e + f*x^2))]
    @test_int [(a + b*x^2)*(e + f*x^2)^(1/2)*(c + d*x^2)^(1/2), x, 6, ((5*a*d*f*(d*e + c*f) - 2*b*(d^2*e^2 - c*d*e*f + c^2*f^2))*x*sqrt(c + d*x^2))/(15*d^2*f*sqrt(e + f*x^2)) + ((b*d*e - 2*b*c*f + 5*a*d*f)*x*sqrt(c + d*x^2)*sqrt(e + f*x^2))/(15*d*f) + (b*x*(c + d*x^2)^(3/2)*sqrt(e + f*x^2))/(5*d) - (sqrt(e)*(5*a*d*f*(d*e + c*f) - 2*b*(d^2*e^2 - c*d*e*f + c^2*f^2))*sqrt(c + d*x^2)*Elliptic.E(atan((sqrt(f)*x)/sqrt(e)), 1 - (d*e)/(c*f)))/(15*d^2*f^(3/2)*sqrt((e*(c + d*x^2))/(c*(e + f*x^2)))*sqrt(e + f*x^2)) - (e^(3/2)*(b*d*e + b*c*f - 10*a*d*f)*sqrt(c + d*x^2)*Elliptic.F(atan((sqrt(f)*x)/sqrt(e)), 1 - (d*e)/(c*f)))/(15*d*f^(3/2)*sqrt((e*(c + d*x^2))/(c*(e + f*x^2)))*sqrt(e + f*x^2))]
    @test_int [(a + b*x^2)*(e + f*x^2)^(1/2)/(c + d*x^2)^(1/2), x, 5, ((b*d*e - 2*b*c*f + 3*a*d*f)*x*sqrt(c + d*x^2))/(3*d^2*sqrt(e + f*x^2)) + (b*x*sqrt(c + d*x^2)*sqrt(e + f*x^2))/(3*d) - (sqrt(e)*(b*d*e - 2*b*c*f + 3*a*d*f)*sqrt(c + d*x^2)*Elliptic.E(atan((sqrt(f)*x)/sqrt(e)), 1 - (d*e)/(c*f)))/(3*d^2*sqrt(f)*sqrt((e*(c + d*x^2))/(c*(e + f*x^2)))*sqrt(e + f*x^2)) - ((b*c - 3*a*d)*e^(3/2)*sqrt(c + d*x^2)*Elliptic.F(atan((sqrt(f)*x)/sqrt(e)), 1 - (d*e)/(c*f)))/(3*c*d*sqrt(f)*sqrt((e*(c + d*x^2))/(c*(e + f*x^2)))*sqrt(e + f*x^2))]
