    @test_int [(a + b*x^2)^(1/2)/(sqrt(c + d*x^2)*sqrt(e + f*x^2)), x, 2, (a*sqrt(c + d*x^2)*sqrt((a*(e + f*x^2))/(e*(a + b*x^2)))*Elliptic.Pi((b*c)/(b*c - a*d), asin((sqrt(b*c - a*d)*x)/(sqrt(c)*sqrt(a + b*x^2))), (c*(b*e - a*f))/((b*c - a*d)*e)))/(sqrt(c)*sqrt(b*c - a*d)*sqrt((a*(c + d*x^2))/(c*(a + b*x^2)))*sqrt(e + f*x^2))]
    @test_int [1/((a + b*x^2)^(1/2)*sqrt(c + d*x^2)*sqrt(e + f*x^2)), x, 2, (sqrt(e)*sqrt(c + d*x^2)*sqrt((a*(e + f*x^2))/(e*(a + b*x^2)))*Elliptic.F(asin((sqrt(b*e - a*f)*x)/(sqrt(e)*sqrt(a + b*x^2))), ((b*c - a*d)*e)/(c*(b*e - a*f))))/(c*sqrt(b*e - a*f)*sqrt((a*(c + d*x^2))/(c*(a + b*x^2)))*sqrt(e + f*x^2))]
    @test_int [1/((a + b*x^2)^(3/2)*sqrt(c + d*x^2)*sqrt(e + f*x^2)), x, 0, Unintegrable(1/((a + b*x^2)^(3/2)*sqrt(c + d*x^2)*sqrt(e + f*x^2)), x)]
    end
